import styled from 'styled-components';

export const StyledHeader = styled.header`
    background-color: 'yellow';
    padding: 40px 0;
`

export const Nav = styled.nav`
    display:flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 40px;
`

export const Logo = styled.img`

`
